import { useEffect,useState, React  } from 'react';


export default function Lists() {
    const KEY = 'ac733e4361119585d5f69a529226d016';
    const yesterday = new Date((new Date())-86400000);
    let targetDT = yesterday.getFullYear()+(yesterday.getMonth()+1).toString().padStart(2,0)+(yesterday.getDate()).toString().padStart(2,0);
    const[data,setData]=useState([]);

    "vjda43t2Pd"



    useEffect(() => {
        const getMovies = async(movie) => {
            const json = await (
                await fetch(`/v1/search/movie.json?query=${movie.movieNm}`, {
                    method: 'GET',
                    headers: {
                        "X-Naver-Client-Id":"rkuFsJw7BejTzImF1dlV",
                        "X-Naver-Client-Secret":"vjda43t2Pd"
                    }
                })
            ).json();
            return {
                "rank":movie.rank,
                "poster":json.items[0].image,
                "title":movie.movieNm,
                "subtitle":json.items[0].subtitle,   
                "openDt":movie.openDt,
                "rating":json.items[0].userRating   
            }
        }
        const getBoxOffice = async() => {
            const response = await(await (
                await fetch(
                    `https://kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json?key=${KEY}&targetDt=${targetDT}`
                )
            ).json()).boxOfficeResult.dailyBoxOfficeList;
            //console.log(response);
            //console.log(data);
            const boxOffice = response.map((movie) => getMovies(movie));

            await Promise.all(boxOffice).then((result) => {
                //console.log(result);
                setData(result);
            });
        }
        getBoxOffice();
    }, [targetDT]);

    return (
    <div class="px-[40px] pt-[25px]">
        <ul>
            {data.map((item)=>(
            <li class="px-3 py-2">
                <div class="flex">
                    <img src={item.poster} alt="Err" class=" mr-5 float-left w-[90px]"></img>
                    <div>
                        <p class="font-extrabold w-full text-[16pt]">{item.title}</p>
                        <p class="font-medium w-full text-[12pt] mt-2">{item.subtitle}</p>
                        <p class="font-medium text-[#888888] text-[10pt] mt-2">{item.openDt.replaceAll("-",".")}</p>
                        <span class="text-[#FFD177] text-[16pt] mt-3">★</span><span class="font-bold text-[14pt] mt-3"> {item.rating}</span>
                    </div>
                </div>

                <div>
                    <ul>
                        <li>
                            <div class="flex items-center mt-3">
                                <img src={require('./images/profile_sample.png')} class="w-7 h-7 mr-3" alt="Default"></img>
                                <span class="font-[450] text-[16px] align-center ">최고에요</span>
                            </div>
                        </li>
                        <li>
                            <div class="flex items-center mt-3">
                                <img src={require('./images/profile_sample.png')} class="w-7 h-7 mr-3" alt="Default"></img>
                                <span class="font-[450] text-[16px] align-center ">최고에요</span>
                            </div>
                        </li>
                    </ul>
                </div>

                <div>
                <form class="group relative w-full mt-2">
                    <div class="star-rating">
                        <input type="radio" id="5-stars" name="rating" value="5" />
                        <label for="5-stars" class="star">&#9733;</label>
                        <input type="radio" id="4-stars" name="rating" value="4" />
                        <label for="4-stars" class="star">&#9733;</label>
                        <input type="radio" id="3-stars" name="rating" value="3" />
                        <label for="3-stars" class="star">&#9733;</label>
                        <input type="radio" id="2-stars" name="rating" value="2" />
                        <label for="2-stars" class="star">&#9733;</label>
                        <input type="radio" id="1-star" name="rating" value="1" />
                        <label for="1-star" class="star">&#9733;</label>
                    </div>
                    <div class="flex items-center justify-between">
                    <input type='text' placeholder='Answer the question'
                            class="form-input w-full rounded-md border-[#D9D9D9] shadow-m
                            focus:border-[#B3C9AA] focus:ring focus:ring-[#64A2BD] focus:ring-opacity-50"/>
                    <input type="submit" value="Reply" class="form-input hover:bg-[#598A9E] rounded-md bg-[#64A2BD] border-[#64A2BD] text-white text-sm font-medium align-center ml-2 py-2.5 px-3 shadow-m"/>
                    </div>

                    </form>

                </div>
            </li>
            ))}
        </ul>
    </div>
    )
}
